package lxl.work;

/**
 * @program: leetcode-hz
 * @description: 5485. 找出最长的超赞子字符串
 * <p>
 * <p>
 * 给你一个字符串 s 。请返回 s 中最长的 超赞子字符串 的长度。
 * <p>
 * 「超赞子字符串」需满足满足下述两个条件：
 * <p>
 * 该字符串是 s 的一个非空子字符串
 * 进行任意次数的字符交换重新排序后，该字符串可以变成一个回文字符串
 * <p>
 * <p>
 * <p>
 * 示例 1：
 * <p>
 * 输入：s = "3242415"
 * 输出：5
 * 解释："24241" 是最长的超赞子字符串，交换其中的字符后，可以得到回文 "24142"
 * <p>
 * 示例 2：
 * <p>
 * 输入：s = "12345678"
 * 输出：1
 * <p>
 * 示例 3：
 * <p>
 * 输入：s = "213123"
 * 输出：6
 * 解释："213123" 是最长的超赞子字符串，交换其中的字符后，可以得到回文 "231132"
 * <p>
 * 示例 4：
 * <p>
 * 输入：s = "00"
 * 输出：2
 * <p>
 * <p>
 * <p>
 * 提示：
 * <p>
 * 1 <= s.length <= 10^5
 * s 仅由数字组成
 * @author: lxl
 * @create: 2020-08-08 22:34
 **/
public class FindLongestAwesomeSubstring {

    public int longestAwesome(String s) {
        int[] nums;
        int singleCount;
        int l = s.length();
        char[] chars = s.toCharArray();
        int ans = 1;
        int i = 0;
        while (i < l) {
            if (ans >= l - i) {
                break;
            }
            int index = chars[i] - '0';
            nums = new int[10];
            singleCount = 1;
            nums[index]++;
            int next = i + 1;
            for (int j = i + 1; j < l; j++) {
                if (singleCount > l - j + 1) {
                    break;
                }
                int innerIndex = chars[j] - '0';
                nums[innerIndex]++;
                if (nums[innerIndex] % 2 == 1) {
                    singleCount++;
                } else {
                    singleCount--;
                }
                if (singleCount <= 1) {
                    ans = Math.max(ans, j - i + 1);
                    next = j + 1;
                }

            }
            i = next;
        }
        return ans;
    }

    //"053914486546058"  9
    public static void main(String[] args) {
        FindLongestAwesomeSubstring longestAwesome = new FindLongestAwesomeSubstring();
        //System.out.println(longestAwesome.longestAwesome(""));
    }
}
